import React, { Fragment } from 'react'
import {Route , Routes , BrowserRouter as Router} from 'react-router-dom'


function App() {
  return (
    <Fragment>
        <Router>
          <Routes>
            <></>
          <Route path="/" element={<HomePage/>} />
          
          </Routes>
        </Router>
    </Fragment>
  )
}

export default App;
